import React from "react";

class Lesson extends React.Component{
    render(){
        return(
            <div className="Lesson">
                <h2 className="Lesson-h2">
                    Запишитесь 
                    на бесплатное пробное
                    занятие прямо сейчас!
                </h2>
                <form className="Lesson-form">
                    <input type="text" className="Lesson-Student_name Lesson-fi" placeholder="Student name" name="Student_name"/>
                    <input type="text" className="Lesson-Parent_name Lesson-fi" placeholder="Parent_name" name="Parent_name"/>
                    <input type="tel" className="Lesson-tel Lesson-fi" placeholder="+7 (999) 999-99-99" name="tel"/>
                    <input type="email" className="Lesson-email" placeholder="Email (optional)" name="email"/>
                    
                </form>
            </div>
        )
    }
}

export default Lesson;
